    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - 6 NOT BETWEEN + col0 + - col2 AND 27 + + - col1 AND - 44 - + - ( - col1 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q10761.out
    data: |
      85	5	59
      91	47	68
